DROP TABLE IF EXISTS `mbs_all_assessment`;
CREATE TABLE `mbs_all_assessment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `server_no` varchar(255) NOT NULL COMMENT '服务编号',
  `customer_id` int(11) NOT NULL COMMENT '客户id',
  `customer_name` varchar(255) NOT NULL COMMENT '客户名称',
  `server_id` int(11) DEFAULT NULL COMMENT '分配技师id',
  `server_name` varchar(255) DEFAULT NULL COMMENT '技师名称',
  `chain_id` int(11) DEFAULT NULL COMMENT '门店id',
  `reception` int(11) DEFAULT NULL COMMENT '接待人_id',
  `solution` varchar(255) DEFAULT NULL COMMENT '祛斑方案',
  `customer_sign` blob NOT NULL COMMENT '顾客确认签字',
  `dean_sign` blob COMMENT '院长确认签字',
  `ask_time` datetime NOT NULL COMMENT '咨询日期',
  `adduser_id` int(11) NOT NULL COMMENT '添加人id',
  `create_time` datetime NOT NULL COMMENT '创建日期',
  `update_time` datetime DEFAULT NULL COMMENT '修改日期',
  `other` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态',
  `skin_cate` varchar(255) DEFAULT NULL COMMENT '皮肤类型',
  `health` varchar(255) DEFAULT NULL COMMENT '身体情况',
  `freckle_experience` varchar(255) DEFAULT NULL COMMENT '祛斑经历',
  `stains_cate` varchar(255) DEFAULT NULL COMMENT '色斑类型',
  `done_skincare` tinyint(2) DEFAULT NULL COMMENT '是否做过皮肤护理 1是 2否 3定期',
  `micro_surgery` tinyint(2) DEFAULT NULL COMMENT '是否做过微整形 1是 2否 ',
  `surgery_detail` varchar(255) DEFAULT NULL COMMENT '微整详情',
  `product` varchar(255) DEFAULT NULL COMMENT '配增产品表 多个产品用逗号隔开',
  `pictures` varchar(255) DEFAULT NULL COMMENT '上传图片凭证 逗号隔开',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='综合测评信息表';

